import  React, { useEffect,useState } from 'react'
import axios from 'axios'
import serverApiHost from "../../global";


const PageAllCards = () =>
{

    const [message, setMessage] = useState()

    const GetInformationAboutCard = async () => {

        const response = await axios.get('http://'+serverApiHost+':5001/api/cardVSM/view')

        if(response.status != 200)
        {
          return ;
        }

        let content = response.data as any;

        setMessage(content);

        console.log("LOADING")
    }


    useEffect(() => {
         GetInformationAboutCard();
    },[])

    return (
        <div>
            <p>PageAllCards</p>
            <p>{message}</p>
        </div>
    )   
}


export default PageAllCards;
